import React from "react"

class Output extends React.Component{
    render(){
        return(
            <div>
                <Modal isOpen={this.props.opmodel}>
                    <ModalHeader toggle={this.props.toggleoutput} charCode="X">Output</ModalHeader>
                    <ModalBody style={{paddingLeft:"10px",paddingRight:"10px",paddingTop:"10px",paddingBottom:"4px"}}>
                        <textarea id="inputbox">

                        </textarea>
                    </ModalBody>
                </Modal>
          </div>
        );
    }
}
export default Output;
